CREATE PROCEDURE [Items].[UpdateBagDetail]
	@Table [Items].[BagDetail] READONLY,
	@Id INT OUTPUT
	WITH EXECUTE AS CALLER
AS

BEGIN SET NOCOUNT ON;
DECLARE @ConsumableId INT = null
